const MongoClient = require('mongodb').MongoClient;
const uri = "mongodb+srv://steven:admin123@cluster0.b3s46.mongodb.net/tradingbot?retryWrites=true&w=majority";
const client = new MongoClient(uri);


async function check(em, pass){
        try{

          await client.connect();

          const collection = client.db("tradingbot").collection("users");

          const query = {email: em, password: pass};
          const options = {
              sort: {rating: -1},
            projection: {_id:0, username:0, role:0, accountId:0, dateCreated:0, email:1, password:1, firstName: 1, lastName:1}
          };

          const results = collection.findOne(query, options);

        console.log(results);

        }finally{
          await client.close();
      }
}

export default check;
